package minimumwindowsubstring

import (
	"fmt"
	"testing"

	"github.com/stretchr/testify/assert"
)

type testCase struct {
	s, t     string
	expected string
}

func TestMinWindow(t *testing.T) {
	testcases := []testCase{
		{
			s:        "ADOBECODEBANC",
			t:        "ABC",
			expected: "BANC",
		},
		{
			s:        "a",
			t:        "a",
			expected: "a",
		},
		{
			s:        "a",
			t:        "aa",
			expected: "",
		},
		{
			s:        "abc",
			t:        "b",
			expected: "b",
		},
		{
			s:        "",
			t:        "",
			expected: "",
		},
	}
	for i, tc := range testcases {
		t.Run(fmt.Sprintf("%d", i), func(t *testing.T) {
			assert.Equal(t, tc.expected, minWindow(tc.s, tc.t))
		})
	}
}
